import React, { useState } from "react";
import "../../App.scss";
import TopBar from "../../components/TopBar/TopBar";
import Footer from "../../components/Footer/Footer";
import "./Contact.scss";

const Contact = () => {
  const [formData, setFormData] = useState({
    userName: "",
    lastName: "",
    email: "",
    phone: "",
    message: "",
    agree: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === "checkbox" ? checked : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8000/contact/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("Message sent successfully!");
        setFormData({
          userName: "",
          lastName: "",
          email: "",
          phone: "",
          message: "",
          agree: false,
        });
      } else {
        alert("Failed to send message. Please try again.");
      }
    } catch (error) {
      console.error("Error submitting form:", error);
      alert("An error occurred while sending the message.");
    }
  };

  return (
    <>
      <div className="contact-page">
        <TopBar />
      </div>

      <main className="main main-contact">
        <section className="contact">
          <h1 className="contact-title">Contact us</h1>

          <div className="contact-content">
            <div className="contact-content__form">
              <form autoComplete="on" onSubmit={handleSubmit} className="contact__message-form">
                <div className="contact__names">
                  <div className="user-name">
                    <label htmlFor="user-name" className="form__label">Name*</label>
                    <input
                      type="text"
                      id="user-name"
                      className="form__input"
                      name="userName"
                      value={formData.userName}
                      onChange={handleChange}
                      placeholder="Enter your name"
                      required
                    />
                  </div>

                  <div className="company-name">
                    <label htmlFor="last-name" className="form__label">Last name*</label>
                    <input
                      type="text"
                      id="last-name"
                      className="form__input"
                      name="lastName"
                      value={formData.lastName}
                      onChange={handleChange}
                      placeholder="Enter your last name"
                      required
                    />
                  </div>
                </div>

                <div className="contact__info">
                  <div className="contact__email">
                    <label htmlFor="user-email" className="form__label">Email*</label>
                    <input
                      id="user-email"
                      className="form__input"
                      type="email"
                      name="email"
                      value={formData.email}
                      onChange={handleChange}
                      placeholder="Enter your email"
                      required
                    />
                  </div>

                  <div className="contact__phone">
                    <label htmlFor="user-phone" className="form__label">Phone number*</label>
                    <input
                      id="user-phone"
                      className="form__input"
                      type="tel"
                      name="phone"
                      value={formData.phone}
                      onChange={handleChange}
                      placeholder="Enter your phone number"
                      required
                    />
                  </div>
                </div>

                <div className="contact__message form__control">
                  <label htmlFor="user-message" className="form__label">Message*</label>
                  <textarea
                    name="message"
                    className="form__input"
                    value={formData.message}
                    onChange={handleChange}
                    placeholder="Enter your message"
                    required
                  ></textarea>
                </div>

                <div className="contact__sent">
                  <div className="contact__policy">
                    <label className="contact__checkbox-label">
                      <input
                        className="check-box"
                        type="checkbox"
                        name="agree"
                        checked={formData.agree}
                        onChange={handleChange}
                        required
                      />
                      <span className="contact__checkbox-text">I agree</span>
                    </label>
                  </div>

                  <div className="contact__button">
                    <button className="contact__text" type="submit">SUBMIT</button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default Contact;
